import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

function ncard(val) {
  return (
    <App
      key={val.id}
      pic={val.pic}
      cat={val.cat}
      tit={val.tit}
      link={val.link}
      dlink={val.dlink}
    />
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
